import React from 'react';
import './App.css';

const PokemonList = ({pokemon}) => {
    return(
        <div className="pokemonList">
            {pokemon.map(p => (
                <div className="card" key={Math.random()}>
                <h2>{p.count}</h2>
                <div className="pokemon-name" key={p}>{p.weight}</div>
                <button className="btn btn-danger btn-lg">See Details</button>
                </div>
            ))}
        </div>
    )
}

export default PokemonList;
